import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

export default function Posts(posts) {
  console.log("posts", posts);
  return (
    <>
    {posts.post.map((post, index) => {
        <p>test</p>
    })}

    <Container>
      {posts.post.map((post, index) => {
        return (<Row>
          <Col>{post.title}</Col>
          <Col>{post.body}</Col>
        </Row>)
      })}
    </Container>
    </>

  );
}
